import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = { starWarsList: "" };
  }
  componentDidMount() {
    fetch("http https://swapi.py4e.com/api/people/1/")
      .then((resp) => resp.json())
      .then((result) => {
        return this.setState({ starWarsList: result });
      });
  }

  render() {
    return <div className="App"></div>;
  }
}

export default App;
